import Link from 'next/link';
import data from "../response.json"


export default () => {
  let result 
  let array = []
  let i = 0
  let sections = []
  let obj1 = data.tree[0].children
  let obj2 = data.tree[2].children
  // console.log(obj1)
  // while (i < obj1.length) {
  //   result = obj1[i].children
  //   var name = obj1[i].name
  //   sections.push(name)

  //   for (var j = 0; j < result.length; j++) {
  //     var temp = result[j].path
  //     array.push(temp)
  //   }
  //   i++
  // }
  //  var obj2 = data.tree[2].children
  //   while (i < obj2.length) {
  //       result = obj2[i].children
  //       for (j = 0; j < result.length; j++) {
  //         var  temp = result[j].path
  //           array.push(temp)
  //       }
  //       i++
  //   }
  // console.log(array)
  return (
    
      <div className="App">
        <div className="flex">
          <div>
            <h1>Marketing</h1>
            <ul>
              {
                obj1 && obj1.map((item, index) => {
                  return (
                    <li key={index}> <Link to={"/detail/" + item.name}><strong> {item.name}</strong> <br></br> ({item.children.length} components) </Link></li>
                  )
                })
              }
            </ul>
          </div>
          <div>
            <h2>Application UI</h2>
            <ul>
              {
                obj2 && obj2.map((item, index) => {
                  return (
                    <li key={index}> <Link to={"/detail/" + item.name}> <strong>{item.name}</strong> <br></br>({item.children.length} components) </Link> </li>
                  )
                })
              }
            </ul>
          </div>
        </div>
      </div>
  );
};
